Why does adding index worsen performance?<p>I'm evaluating the performance of the following query.</p>

<pre><code>db.products_old.find({ regularPrice: { $lte: 200 } })
</code></pre>

<p>The collection has a bit over a million documents, in total around 0.15GB.</p>

<hr>

<h1>No indexes</h1>

<p>This is expected. A full column scan has to be done</p>

<pre><code>"executionTimeMillis" : 1019,
</code></pre>

<p><sub></sub></p>

<pre><code>"winningPlan" : {
    "stage" : "COLLSCAN",
    "filter" : {
        "regularPrice" : {
            "$lte" : 200
        }
    },
    "direction" : "forward"
},
</code></pre>

<h1>Index { regularPrice: 1 }</h1>

<pre><code>"executionTimeMillis" : 2842,
</code></pre>

<p><sub></sub></p>

<pre><code>"winningPlan" : {
    "stage" : "FETCH",
    "inputStage" : {
        "stage" : "IXSCAN",
        "keyPattern" : {
            "regularPrice" : 1
        },
        "indexName" : "regularPrice_1",
        "isMultiKey" : false,
        "multiKeyPaths" : {
            "regularPrice" : [ ]
        },
        "isUnique" : false,
        "isSparse" : false,
        "isPartial" : false,
        "indexVersion" : 2,
        "direction" : "forward",
        "indexBounds" : {
            "regularPrice" : [
                "[-inf.0, 200.0]"
            ]
        }
    }
},
</code></pre>

<p>Now it uses the index, but the execution time is noticeably worse. <strong>Why?</strong></p>

<p>Also, if it's worse performance, <strong>why doesn't Mongo use the <code>COLLSCAN</code> instead</strong> of using the index which slows down the execution? <code>rejectedPlans</code> is empty, which suggests that no other plan was even considered. Why?</p>

<hr>

<p><a href="https://gist.github.com/lazarljubenovic/5a65f49a3f8ed8c90fc8c74622a9ac3a" rel="nofollow noreferrer">Here's</a> the full <code>allPlansExecution</code> output.</p>

