Mongoose save() returning old version, not saved version of document<p>I must be missing something, but it seems that my <code>Document.prototype.save()</code> is not working for me properly in Mongoose 5.2.10. </p>

<p><a href="https://mongoosejs.com/docs/api.html#document_Document-save" rel="nofollow noreferrer">The docs say</a> that the callback returns the <strong>saved document</strong>. </p>

<blockquote>
  <p>The callback will receive two parameters</p>

  <ul>
  <li><code>err</code> if an error occurred </li>
  <li><code>product</code> <strong>which is the saved</strong> <code>product</code></li>
  </ul>
</blockquote>

<p>For me, it seems to be returning the original version of the document before the update and save. Either I'm doing something wrong, or the docs are a little misleading or vague.</p>

<p>After calling save, the document is updated in the database, but the callback returns the old document, before the modification.</p>

<p>I have been calling save like this (inside an async function):</p>

<pre><code>const myDocument = await User.findOne({ name: 'billy' });
const updatedInfo = {
    foo: 'update here',
    bar: 'some other new stuff'
};
myDocument.update({ $set: updatedInfo }, (err) =&gt; { console.log(err) });
myDocument.save((err, savedDoc) =&gt; {
    if (err) { console.log(err); }
    // Should return saved doc here
    console.log(savedDoc);
});
</code></pre>

<p>And like this:</p>

<pre><code>myDocument.update({ $set: updatedInfo }, (err) =&gt; { console.log(err) });
myDocument.save().then((savedDoc) =&gt; {
    // Should return saved doc here
    console.log(savedDoc);
}).catch((err) =&gt; { console.log(err); });
</code></pre>

<p>But can't get it to return me the saved document. <code>savedDoc</code> ends up being the old version of the document, while the new version does get saved in the database.</p>

